const Body = () => {
    const objA = {
        a: 1,
        b: 2
    }
    return (
        <div>
            <h1>This is the Body component</h1>
            <p>Welcome to the body of the application.</p>
            <h2>{objA.a}</h2>
            <h2>{objA.b}</h2>
        </div>
    );
};

export default Body;
